import logo from './26524664.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>Nopp!</code> Ok
        </p>
        <a
          className="App-link"
          href="https://github.com/nopparat231/web-nopp"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn Nopp!
        </a>
      </header>
    </div>
  );
}

export default App;
